  false,\n\t\"url\": null,\n\t\"notes\": \"This report covers the distribution, abundance,
  and productivity of tundra swans in the coastal wetlands of the Arctic National
  Wildlife Refuge. Two aerial surveys of tundra swans utilizing coastal wetlands of
  Arctic National Wildlife Refuge were conducted in 1983. The first, survey, a breeding
  pair/nesting survey, was conducted on 2-3 June; a second survey to determine productivity,
  was conducted on 21 August. These surveys are used to describe the distribution,
  abundance, and productivity of the tundra swan population. Methods and results are
  included.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
